import React from "react";
import { useDrag } from "react-dnd";
import Avatar from "@mui/material/Avatar";
import Card from "@mui/material/Card";
import CardHeader from "@mui/material/CardHeader";
import Team from "./Team";
function Employee({ employee: employee }) {
  const [{ isDragging }, drag] = useDrag(() => ({
    type: "employee",
    item: { employee: employee },
    end: () => {
      console.log(employee, "employewwwwwwwwwwwwwwwwe");
    },
    collect: (monitor) => ({
      isDragging: !!monitor.isDragging(),
    }),
  }));
  const style = {
    backgroundColor: "rgba(255, 255, 255, 0.3)",
    borderRadius: "20px",
  };
  return (
    <Card className="employee" ref={drag} style={style}>
      <CardHeader
        avatar={<Avatar src={employee["Avatar"]["url"]} />}
        title={employee.Name}
        subheader={employee.JobTitle}
      />
      {employee.teams.map((team) => {
        return (
          <Col
            key={team.id}
            style={{
              display: "flex",
              flexDirection: "row",
            }}
          >
            <Team team={team} employees={props.employees} teams={props.teams} />
          </Col>
        );
      })}
    </Card>
  );
}

export default Employee;
